import React from "react";

export default function ContactMe() {
  return (
    <div>
      <div className="about-me-bg-1"></div>
      <div className="about-me-bg-2"></div>
      <div className="page-container">
      <p className="page-name">Contact details</p>
      <p className="contact-details"> Name: Rishabh Goel</p>
      <p className="contact-details"> Email: rishabhg0707@gmail.com</p>
      <p className="contact-details"> Phone: +44 744 3888 379</p>
    </div>
    </div>
  )
}
